import React, { useState, useEffect } from "react";
import axios from "axios";
import Marker from './Marker';

const shelterAPI = "http://localhost:5000/api/shelters";

function ShelterAPI() {
  const [shelterData, setShelterData] = useState({});

  useEffect(() => {
    // getGitHubUserWithFetch();
    getGiHubUserWithAxios();
  }, []);

  const getGitHubUserWithFetch = async () => {
    const response = await fetch(shelterAPI);
    const jsonData = await response.json();
    setShelterData(jsonData);
  };

  const getGiHubUserWithAxios = async () => {
    const response = await axios.get(shelterAPI);
    setShelterData(response.data);
  };

  return (
            <Marker
            text={shelterData.shelterName}
            lat={shelterData[0].latitude}
            lng={shelterData[0].longitude}
                />


    
  );
}

export default ShelterAPI;
